#include <iostream>
#include <string>
#include <algorithm>

using namespace std;

class Solution {
public:
    string shortestPalindrome(const string &s) {
        if (s.empty()) return s;
        
        // Find the longest palindromic prefix
        int n = s.size();
        int longest = 0;
        
        // Check each possible prefix length
        for (int i = n; i >= 1; --i) {
            bool isPalindrome = true;
            for (int j = 0; j < i / 2; ++j) {
                if (s[j] != s[i - 1 - j]) {
                    isPalindrome = false;
                    break;
                }
            }
            if (isPalindrome) {
                longest = i;
                break;
            }
        }
        
        // Reverse the remaining suffix and prepend it
        string suffix = s.substr(longest);
        reverse(suffix.begin(), suffix.end());
        
        return suffix + s;
    }
};

int main() {
    Solution s;

    cout << s.shortestPalindrome("aacecaaa") << endl; //aaacecaaa
    cout << s.shortestPalindrome("abcd") << endl; //dcbabcd
    cout << s.shortestPalindrome("") << endl; //""
    cout << s.shortestPalindrome("abb") << endl; //bbabb
    cout << s.shortestPalindrome("") << endl; //bbabb

    return 0;
}
